import './App.css';
import axios from 'axios';
import { useState } from 'react';
// import NewPost from './NewPost';
function App() {
  const [file, setFile] = useState();
  const test = async () => {
    await axios
      .get('/')
      .then((response) => {
        console.log(response.data);
        setFile(response.data);
      })
      .catch((error) => {
        console.log(error);
      });
  };
  test()

  return (
    <div className="App">
      <h1>Insta App</h1>
      {/* <NewPost></NewPost> */}
      {file}
    </div>
  );
}

export default App;

